import './App.css';
import React, {useState,useEffect } from 'react';
const hello = (symbol) => {
  fetch(`http://127.0.0.1:5000/v0/ticker?id =` + symbol, {
  method: 'GET',
  headers: new Headers({
    'Content-Type': 'application/x-www-form-urlencoded',
  }),
})
  .then((response) => {
    if(!response.ok) {
      throw response;
    }
    return response.json();
  })
  .then((json) => {
    console.log(json)
  })
}
function App() {
  // const [stock, setStock] = useState([]);
  const [symbol, setSymbol] = useState("");
  useEffect(() => {
    console.log(symbol)
    hello(symbol);
  },[symbol]);
  return (
    <div>
    <form>
      <input type = "text" name = "name"/>
      <input type = "submit"
      onSubmit= {(event) =>
      setSymbol(event.target.value)}
      value = "Submit" />
    </form>
    </div>
  );
}

export default App;
